import "./home.css"
import monitor from "../../logos/monitor.png";

export const Home = () => {
    return (
        <div className="wrapper">
            <div className="header">
                <div className="content">
                    <div className="info"></div>
                    <img  classNamesrc={monitor}/>
                </div>
            </div>
        </div>
    )
}
